import React, { useState, useEffect } from "react";
import {useHistory, useParams} from 'react-router-dom'
import Nav from "../nav/nav"
import '../../style.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import AddProject from "./AddProjectData";
import EditProject from "./EditProject"


const ViewProject = () => {

    const [projectData, setProjectData] = useState([]);


    const data = {
      data: projectData
  }

    // const history = useHistory();

    // const resumeInfo = {
    //     patientID:id, 
    //     careproviderID: careprovider
    // }

    // const resumeInfoEdit = {
    //     patientID:id, 
    //     patientEditID: patientEdit
    // }


  useEffect(() => {

    async function fetchData() {
      const res = await fetch(`http://localhost:4000/projects`);
      res.json().then((res) => setProjectData(res));

    }
    fetchData();
  });

  return (
    <div>
      <Nav />
        <h2 className="work-h2">My Projects</h2>
        <AddProject data={projectData} />
        <section className="resume">
            {projectData.map((data) =>
                <div className="work-div">
                    <h3>{data.projectName}</h3>
                    <h4>{data.description}</h4>
                    <EditProject projectEntry={data} />
                    <img src={data.img} alt={data.projectName} width="300" height="200" />
                    <a href={data.link}>Click Here to See</a>
                    <hr className="work-seperation" />
                </div>
            )}
        </section>
    </div>
  );
};

export default ViewProject;
